A footstomping return to the BBC vaults of Top of the Pops, The Old Grey Whistle Test and 
Later with Jools as the programme spins itself to a time when disco ruled the floor, the 
airwaves and our minds. The visual floorfillers include classics from luminaries such as 
Chic, Labelle and Rose Royce to glitterball surprises by the Village People and Gladys 
Knight.
